<script lang="ts">
	/** define @global TabSystem, Tab */
	import Footer from './footer.svelte';
	import './main.css';
	import { onMount } from 'svelte';
	const quotes = [
		'"faulty flaunts"',
		'Run by the best.',
		'The best.',
		'Updated to v5!',
		'The best proxy.',
		'Only The Best',
		'Join our discord server!',
		'Made for you',
		'Made for the masses...'
	];

  	let createNewTab: () => void;
	let quote = quotes[Math.floor(Math.random() * quotes.length)];
	let ts : any;
	onMount(async () => {
			let quoteElem = document.getElementById('quote');
			if (quoteElem) {
				quoteElem.innerText = quote;
				quoteElem.removeAttribute('id');
			}
			await updateNews();
			document.getElementById("adrbar").addEventListener("keydown", (e) => {
  if (e.key === "Enter") {
    e.preventDefault();
    if (document.getElementById("adrbar").value === "") return;
    runService(document.getElementById("adrbar").value);
    document.getElementById("adrbar").value
  }
});
			ts = new TabSystem({
				tabContainer: document.getElementById('tabContainer'),
				tabBtnContainer: document.getElementById('tabsBar'),
				btnTemplate: document.getElementById('tabBtnTemplate'),
    			tabTemplate: document.getElementById('tabTemplate'),
    			URlBar: document.getElementById('adrbar'),
    			tabActiveColor: "#333",
    			tabInactiveColor: "#111",
    			defaultPlaceholder: "Type here to search...",
    			closePlaceholder: "No tap open, click the + to open a new tab...",
			});
			let tb = document.getElementById("tabsBar");
			if (tb) {
				tb.addEventListener("wheel", (evt) => {
					evt.preventDefault();
					if (evt.deltaY >= -15 && evt.deltaY <= 15 && tb) {
						tb.scrollLeft += evt.deltaY * 40;
					} else {
						if (!tb) return; // fuck off eslint
						tb.scrollLeft += evt.deltaY * 5;
					}
				}, { passive: false });
			}
    		createNewTab = () => {ts.setActiveTab(ts.addTab(new Tab()))}
    		ts.setActiveTab(ts.addTab(new Tab()))
			ts.on('tabAdd', (tab: any) => {
			tab.getTabElement().querySelector("i").innerText = quote;
				quote = quotes[Math.floor(Math.random() * quotes.length)];
			});
	});

	const updateNews = async () => { // fetches /assets/news.json
		await fetch("/assets/news.json").then((data) => data.json()).then((data) => {
			document.querySelectorAll(".abyssNewsText").forEach((nT) => {
				nT.innerHTML = data.content
			})
			document.querySelectorAll(".abyssFeatGamesText").forEach((gT) => {
				gT.innerHTML = data.gamesContent
			})
			document.querySelectorAll(".abyssFeatGames").forEach((fG) => {
				fG.innerHTML = ""
				for (let i = 0; i < data.includeGames.length; i++) {
					let gC = document.getElementById("gameCardTemplate")?.cloneNode(true) as HTMLElement;
					gC.removeAttribute("id");
					gC.style.display = "inline-block";
					gC.querySelector("img")!.setAttribute("src", data.includeGames[i].image);
					gC.querySelector("img")!.setAttribute("alt", data.includeGames[i].name);
					gC.querySelector("h1")!.innerText = data.includeGames[i].name;
					gC.querySelector("a")!.href = data.includeGames[i].url
					fG.appendChild(gC);
				}
			})
		});
	};
	
	const openNewtab = () => {
		ts.setActiveTab(ts.addTab(new Tab()));
	};

	const runService = async (url) => {
  if (url.trim() == "") return;
  if (ts.getActiveTab() == null) {
    openNewtab();
  }
  ts.getActiveTab().getTabElement().querySelector(".mainStart").style.display = "none";
  if (/^(abyss:)(\/)*[a-z]*/.test(url)) {
    url = url.replace(/^(abyss:)(\/)*/, "");
    document.getElementById("adrbar").value = "";
    switch (url) {
      case "newtab":
        document.getElementById("adrbar").placeholder = ts.getConfig().defaultPlaceholder;
        if (ts.getActiveTab().getTabElement().querySelectorAll(".extFrame")) {
          ts.getActiveTab().getTabElement().querySelectorAll(".extFrame").forEach((frame) => {
            frame.remove();
          });
        }
        ts.getActiveTab().getTabElement().querySelector(".mainStart").style.display = "initial";
        break;
      case "games":
        document.getElementById("adrbar").placeholder = "Abyss Games (abyss://games)";
        if (ts.getActiveTab().getTabElement().querySelectorAll(".extFrame")) {
          ts.getActiveTab().getTabElement().querySelectorAll(".extFrame").forEach((frame) => {
            frame.remove();
          });
        }
        var extensionsTemplate = document.getElementById("games-temp").cloneNode(true);
        extensionsTemplate.id = "";
        extensionsTemplate.style.display = "initial";
        ts.getActiveTab().getTabElement().appendChild(extensionsTemplate);
        break;
      case "settings":
        document.getElementById("adrbar").placeholder = "Abyss Settings (abyss://settings)";
        if (ts.getActiveTab().getTabElement().querySelectorAll(".extFrame")) {
          ts.getActiveTab().getTabElement().querySelectorAll(".extFrame").forEach((frame) => {
            frame.remove();
          });
        }
        var settingsTemplate = document.getElementById("settings-temp").cloneNode(true);
        settingsTemplate.id = "";
        settingsTemplate.style.display = "initial";
        settingsTemplate.querySelector("#themeSelect").addEventListener("change", () => {
          loadedThemes[settingsTemplate.querySelector("#themeSelect").value].apply();
        });
        settingsTemplate.querySelector("#themeSelect").value = loadedThemes.indexOf(currentTheme);
        settingsTemplate.querySelector("#clTitle").placeholder = document.title;
        settingsTemplate.querySelector("#clFav").placeholder = document.querySelector("link[rel='icon']").href;
        settingsTemplate.querySelector("#clTitle").addEventListener("change", () => {
          cloaking = 1;
          toggleCloak(settingsTemplate.querySelector("#clTitle").value, settingsTemplate.querySelector("#clFav").value);
        });
        settingsTemplate.querySelector("#clFav").addEventListener("change", () => {
          cloaking = 1;
          toggleCloak(settingsTemplate.querySelector("#clTitle").value, settingsTemplate.querySelector("#clFav").value);
        });
        ts.getActiveTab().getTabElement().appendChild(settingsTemplate);
        break;
      default:
        if (ts.getActiveTab().getTabElement().querySelectorAll(".extFrame")) {
          ts.getActiveTab().getTabElement().querySelectorAll(".extFrame").forEach((frame) => {
            frame.remove();
          });
        }
        var invalidMainTemplate = document.getElementById("invalid-temp").cloneNode(true);
        invalidMainTemplate.id = "";
        invalidMainTemplate.style.display = "initial";
        ts.getActiveTab().getTabElement().appendChild(invalidMainTemplate);
        return
    }
  }
};
</script>

